import React from 'react';

const TokenInfoPage = () => {
  return (
    <div className="bg-gradient-to-b from-black via-gray-900 to-gray-800 text-white min-h-screen">
      {/* Header Section */}
      <header className="text-center p-10">
        <img 
          src="https://media-hosting.imagekit.io/b0b6ce33c5e6414f/ChatGPT%2520Image%2520May%25206%2C%25202025%2C%252001_14_18%2520AM.png?Expires=1841082450&Key-Pair-Id=K2ZIVPTIP2VGHC&Signature=a3PAHcePRw8Hb-Iukzy5YsVtRXDTnPLMN3TODXFnkL-g2i7sJXyqpHsiQjwZ-T6Np6X1yEy2CELZzHdTUOm2yuuO7Ysd3f25VkSvCEUYxIaIpSoQa5IHzeg7agtCnD1VWVfZ-EYz0wmtfKx6cC0eDqs4vTK6nrrXpgfwzdZPbRV4Cl1opIIS1k356frGtSf4nPtF0shGjzB42Z-abLWPmP4j7~-RvbJl4lRqUsbI1GzRjaAo1PbKDKWD1-1SuY5R6DngWo5Sqy434zS-D5yhRnuTmXpgtGzUacm0PD30ttUvaN542T4moDR5NOB6tYTNyVk2NHzaLQln97jgizhfrA__" 
          alt="Vortrex Logo" 
          className="mx-auto mb-6 w-40 h-40 object-cover rounded-full"
        />
        <h1 className="text-5xl font-extrabold text-[#00FF9F]">Vortrex Token (VTX)</h1>
        <p className="mt-4 text-xl text-gray-300">The future of decentralized finance is here!</p>
      </header>

      {/* Token Details Section */}
      <section className="py-10">
        <h2 className="text-3xl font-semibold text-[#00FF9F] text-center">Token Details</h2>
        <ul className="mt-4 text-center text-gray-300">
          <li>Symbol: VTX</li>
          <li>Total Supply: 1,000,000,000 VTX</li>
          <li>Blockchain: Binance Smart Chain (BEP-20)</li>
        </ul>
      </section>

      {/* Use Cases Section */}
      <section className="py-10">
        <h2 className="text-3xl font-semibold text-[#00FF9F] text-center">Use Cases</h2>
        <p className="mt-4 text-center text-gray-300">
          VTX is designed to be used for staking, governance, and as a utility token within the Vortrex ecosystem.
        </p>
      </section>

      {/* Purchase Button Section */}
      <section className="text-center py-10">
        <button className="bg-gradient-to-r from-pink-600 to-purple-600 text-white px-6 py-3 rounded-full shadow-md hover:scale-105 transition-transform">
          Purchase VTX Token
        </button>
      </section>
    </div>
  );
};

export default TokenInfoPage;
